#   https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string-ii

#   https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string-ii/discuss/447282/Simple-Python-Solution-using-Stack
#   https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string-ii/discuss/393118/Two-Solutions-in-Python-3-(With-and-Without-Stack)


class Solution:
    #   Time Limit Exceeded
    def removeDuplicates0(self, s: str, k: int) -> str:
        if s is None or not (1 <= len(s) <= 10 ** 5) or not (2 <= k <= 10 ** 4):
            return ''

        l = list(s)
        while True:
            before = len(l)
            if before < k:
                break
            for i in range(len(l) - k + 1):
                if all(l[j] == l[i] for j in range(i + 1, i + k)):
                    for j in range(i, i + k):
                        l[j] = None
            l = [i for i in l if i]
            if before == len(l):
                break
        return ''.join(l)

    #   Recursion Error
    def removeDuplicates1(self, s: str, k: int) -> str:
        if s is None or not (1 <= len(s) <= 10 ** 5) or not (2 <= k <= 10 ** 4):
            return ''

        def removeFirstK(word):
            if len(word) < k:
                return word
            if all(word[i] == word[0] for i in range(1, k)):
                return removeFirstK(word[k:])
            tmp = word[0] + removeFirstK(word[1:])
            if all(tmp[i] == tmp[0] for i in range(1, k)):
                return removeFirstK(tmp[k:])
            return tmp

        return removeFirstK(s)

    #   runtime; 1308ms, 5.02%
    #   memory; 13.7MB, 100.00%
    def removeDuplicates2(self, s: str, k: int) -> str:
        if s is None or not (1 <= len(s) <= 10 ** 5) or not (2 <= k <= 10 ** 4):
            return ''

        stack = []
        for c in s:
            while k <= len(stack) and all(stack[-1] == stack[i] for i in range(len(stack) - k, len(stack))):
                [stack.pop() for _ in range(k)]
            else:
                stack.append(c)
        if k <= len(stack) and all(stack[-1] == stack[i] for i in range(len(stack) - k, len(stack))):
            [stack.pop() for _ in range(k)]
        return ''.join(stack)

    #   runtime; 100ms, 37.80%
    #   memory; 14.4MB, 100.00%
    def removeDuplicates(self, s: str, k: int) -> str:
        if s is None or not (1 <= len(s) <= 10 ** 5) or not (2 <= k <= 10 ** 4):
            return ''

        stack = []
        for c in s:
            if 0 < len(stack) and stack[-1][0] == c:
                stack[-1][1] += 1
            else:
                stack.append([c, 1])
            while 0 < len(stack) and stack[-1][1] == k:
                stack.pop()
        return ''.join([ch * cnt for ch, cnt in stack])

    #   https://leetcode.com/explore/challenge/card/april-leetcoding-challenge-2021/595/week-3-april-15th-april-21st/3710
    #   RecursionError: maximum recursion depth exceeded while calling a Python object
    def removeDuplicates3(self, s: str, k: int) -> str:
        if s is None or not (1 <= len(s) <= 10 ** 5) or not (2 <= k <= 10 ** 4):
            return ''

        self.stack = []
        def recur(i):
            if i == len(s):
                return
            if 0 < len(self.stack) and self.stack[-1][0] == s[i]:
                self.stack[-1][1] += 1
            else:
                self.stack.append([s[i], 1])
            while 0 < len(self.stack) and self.stack[-1][1] == k:
                self.stack.pop()
            recur(i + 1)

        recur(0)

        return ''.join(c * cnt for c, cnt in self.stack)


solution = Solution()
data = [('abcd', 2, 'abcd'),
        ('deeedbbcccbdaa', 3, 'aa'),
        ('pbbcggttciiippooaais', 2, 'ps'),
        ('', 10000, ''),
        ('yfttttfbbbbnnnnffbgffffgbbbbgssssgthyyyy', 4, 'ybth'),
        ]
for s, k, expected in data:
    real = solution.removeDuplicates(s, k)
    if 20 < len(s):
        print(f'{s[:20]}..., {k}, expected {expected[:20]}..., real {real[:20]}..., result {expected == real}')
    else:
        print(f'{s}, {k}, expected {expected}, real {real}, result {expected == real}')
